// Data model for menu items and social links
export const menuItems = [
  { id: 1, path: '/', label: 'HOME' },
  { id: 2, path: '/conheca', label: 'CONHEÇA' },

  { id: 4, path: '/cardapio', label: 'CARDÁPIO' },
  { id: 5, path: '/shop', label: 'SHOP' },

];

export const socialLinks = [
  { id: 1, platform: 'instagram', url: '#', icon: 'instagram' },
  { id: 2, platform: 'tiktok', url: '#', icon: 'tiktok' },
  { id: 3, platform: 'facebook', url: '#', icon: 'facebook' },
  { id: 4, platform: 'youtube', url: '#', icon: 'youtube' },
  { id: 5, platform: 'whatsapp', url: '#', icon: 'whatsapp' }
];
